import React from "react";

const EvolucaoVendasLRED = () => {
  return (
    <div className="operacao-container">
      <h2 className="operacao-title">Evolução de Vendas - LRED11</h2>
      <p>Os gráficos serão adicionados aqui futuramente.</p>
    </div>
  );
};

export default EvolucaoVendasLRED;
